eval("\n\nObject.defineProperty(exports, \"__esModule\", {\n  value: true\n});\nexports.heritageList = void 0;\nvar heritageList = [\n// 古建筑类\n{\n  id: 1,\n  name: '晋祠圣母殿',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.F0iP_s5xxVZAAyQvfN4xOwHaGA?w=216&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '北宋',\n  description: '晋祠圣母殿始建于北宋时期。这座建筑在晋祠众多古迹中占据着至关重要的地位，它是晋祠现存最为古老的建筑。其不仅历史悠久，更具有极高的艺术价值和历史意义。圣母殿还是中国现存最为完整的宋代木构建筑之一，充分展现了宋代建筑的独特风格和精湛工艺。它的存在为后人研究宋代建筑提供了珍贵的实物资料。',\n  location: '山西省太原市晋源区晋祠镇',\n  category: '古建筑'\n}, {\n  id: 2,\n  name: '应县木塔',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.DU0ANQvLbr_W39I_vFMEUQHaLH?w=203&h=304&c=7&r=0&o=5&pid=1.7',\n  period: '辽代',\n  description: '应县木塔始建于辽清宁二年，也就是公元 1056 年。它作为中国目前现存的木构建筑中，既是最高的，同时也是最为古老的。其独特的建筑风格和精湛的工艺，展现了古代工匠的卓越智慧和高超技艺。历经数百年的风雨沧桑，应县木塔依然屹立不倒，成为了中国古代建筑的杰出代表之一。',\n  location: '山西省朔州市应县木塔镇',\n  category: '古建筑'\n}, {\n  id: 3,\n  name: '平遥古城',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.XyhKBajsea7DSyyaEdUqiQHaEK?w=304&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '明清',\n  description: '平遥古城是中国保存最为完整的古代县城，1997年被联合国教科文组织列入世界文化遗产名录。古城至今保存完好的明清时期的城墙全长6.4公里，高12米，有六个城门。城内有保存完好的明清街道、商铺、庙宇、民居等，其中以日升昌票号、县衙、城隍庙等最为著名。漫步其中，仿佛穿越回到了几百年前的繁华时代。',\n  location: '山西省晋中市平遥县',\n  category: '古建筑'\n}, {\n  id: 10,\n  name: '大同华严寺',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.WOcT2u9zf5DS8y2j3aXBAwHaE7?w=273&h=182&c=7&r=0&o=5&pid=1.7',\n  period: '辽代',\n  description: '大同华严寺始建于辽代，是中国现存最古老的大型佛教寺院之一。寺内保存有辽代建筑和雕塑，其中以大雄宝殿最为著名，殿内有31尊彩塑，是研究辽代艺术的重要实物资料。',\n  location: '山西省大同市城区',\n  category: '古建筑'\n}, {\n  id: 11,\n  name: '双林寺',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.QNAIfAqYa4BlXo2y3CIBrAHaE7?w=264&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '唐代',\n  description: '双林寺始建于唐代，是中国现存规模最大、保存最为完整的唐代佛教寺院。寺内最为著名的是大佛殿内的泥塑，这些唐代彩塑艺术水平极高，是中国佛教艺术的杰出代表。',\n  location: '山西省忻州市繁峙县',\n  category: '古建筑'\n},\n// 石窟寺类\n{\n  id: 4,\n  name: '云冈石窟',\n  image: 'https://tse1-mm.cn.bing.net/th/id/OIP-C.ZKHGJ6XHp5Ae7w9oFDH7hQHaE9?w=290&h=194&c=7&r=0&o=5&pid=1.7',\n  period: '北魏',\n  description: '云冈石窟是中国古代佛教艺术的杰出代表，始建于北魏时期，距今已有1500多年的历史。石窟内保存有大量的佛像、浮雕和壁画，展现了北魏时期的艺术风格和宗教信仰。这些石窟不仅具有极高的艺术价值，同时也是研究中国古代佛教艺术的重要资料。',\n  location: '山西省大同市云冈区',\n  category: '石窟寺'\n}, {\n  id: 12,\n  name: '龙门石窟',\n  image: 'https://tse1-mm.cn.bing.net/th/id/OIP-C.sq9lsZRxb4wpDs96ZpJj0gHaDw?w=332&h=177&c=7&r=0&o=5&pid=1.7',\n  period: '北魏至唐代',\n  description: '龙门石窟始建于北魏孝文帝年间，历经东魏、西魏、北齐、隋、唐等朝代，是中国著名的石窟艺术宝库。石窟内有佛龛2100多个，造像10万余尊，碑刻题记2800余品，是研究中国古代石窟艺术和佛教发展的重要场所。',\n  location: '河南省洛阳市洛龙区',\n  category: '石窟寺'\n}, {\n  id: 13,\n  name: '麦积山石窟',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.I3q0TRnCqCxaCG5ruchPWwHaE7?w=291&h=194&c=7&r=0&o=5&pid=1.7',\n  period: '后秦至清代',\n  description: '麦积山石窟始建于后秦时期，是中国四大石窟之一。石窟依山凿建，因山形似麦垛而得名。窟内保存有大量的佛教造像和壁画，艺术风格独特，展现了从南北朝到清代近千年间的佛教艺术发展。',\n  location: '甘肃省天水市麦积区',\n  category: '石窟寺'\n}, {\n  id: 14,\n  name: '莫高窟',\n  image: 'https://tse1-mm.cn.bing.net/th/id/OIP-C.u4rEWxRBDIxsiQF5nXevugHaEK?w=369&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '十六国至元代',\n  description: '莫高窟又称敦煌石窟，始建于十六国的前秦时期，是世界上现存规模最大、内容最丰富的佛教艺术宝库。窟内保存有壁画4.5万平方米、彩塑2000余身，内容包括佛教故事、历史人物、社会生活等多方面，是中国古代艺术的瑰宝。',\n  location: '甘肃省酒泉市敦煌市',\n  category: '石窟寺'\n},\n// 陶瓷器类\n{\n  id: 15,\n  name: '青花瓷瓶',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.NKaE-3cFTEqTQ9hjXP_lzgHaKA?w=203&h=274&c=7&r=0&o=5&pid=1.7',\n  period: '明代',\n  description: '这件青花瓷瓶制作于明代永乐年间，是中国青花瓷的代表作品。瓶身绘有精美的花鸟纹样，青花发色纯正，胎质细腻，展现了明代景德镇御窑的高超工艺。青花瓷作为中国特有的瓷器品种，已有600多年的历史，在世界陶瓷史上占有重要地位。',\n  location: '山西博物院',\n  category: '陶瓷器'\n}, {\n  id: 16,\n  name: '汝窑天青釉洗',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.HIn5mQMvzWJDoFZ3iiI9AAAAAA?w=230&h=207&c=7&r=0&o=5&pid=1.7',\n  period: '北宋',\n  description: '汝窑是宋代五大名窑之一，以天青釉色著称。这件天青釉洗制作于北宋晚期，釉色如天空般淡雅清澈，釉面开有细小的冰裂纹，是汝窑的典型特征。汝窑瓷器存世量极少，每一件都是珍贵的文化遗产。',\n  location: '山西博物院',\n  category: '陶瓷器'\n}, {\n  id: 17,\n  name: '唐三彩骆驼俑',\n  image: 'https://tse1-mm.cn.bing.net/th/id/OIP-C.DWhI9vBr7667gtAy-GqeXAHaLd?w=200&h=310&c=7&r=0&o=5&pid=1.7',\n  period: '唐代',\n  description: '唐三彩是唐代特有的彩釉陶器，以黄、绿、白三色为主，故称\"三彩\"。这件骆驼俑生动地塑造了丝绸之路上的运输工具——骆驼的形象，反映了唐代中国与西域的频繁交流。唐三彩工艺精湛，色彩艳丽，是中国古代陶瓷艺术的杰出代表。',\n  location: '山西博物院',\n  category: '陶瓷器'\n}, {\n  id: 18,\n  name: '钧窑天蓝釉花盆',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.-MeTc1DWOwy-3jTvwY5x9gHaGM?w=262&h=219&c=7&r=0&o=5&pid=1.7',\n  period: '宋代',\n  description: '钧窑是宋代五大名窑之一，以变幻莫测的釉色著称。这件天蓝釉花盆釉色如天空般深邃，呈现出独特的\"窑变\"效果，釉面有细小的开片纹。钧窑瓷器是中国古代陶瓷艺术中的瑰宝，具有极高的艺术价值和历史意义。',\n  location: '山西博物院',\n  category: '陶瓷器'\n},\n// 佛像类\n{\n  id: 19,\n  name: '云冈石窟释迦牟尼坐像',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.KlL9qDJ3QtdZVIcMariGnQHaE7?w=282&h=188&c=7&r=0&o=5&pid=1.7',\n  period: '北魏',\n  description: '这尊释迦牟尼坐像位于云冈石窟第20窟，高约13.7米，是中国最大的石窟佛像之一。佛像面部圆润，神态祥和，体现了北魏早期佛像的艺术特点，融合了中原和西域的艺术风格，是研究北魏佛教艺术的重要实物资料。',\n  location: '山西省大同市云冈区',\n  category: '佛像'\n}, {\n  id: 20,\n  name: '铜鎏金弥勒佛坐像',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.BxENXKoFXeRprNXDQC_13AHaG6?w=203&h=190&c=7&r=0&o=5&pid=1.7',\n  period: '唐代',\n  description: '这尊铜鎏金弥勒佛坐像制作于唐代，高约30厘米。佛像面相丰满，神态慈祥，衣纹流畅自然，鎏金工艺精湛，充分展现了唐代佛教造像的艺术特点，是唐代金铜佛像的代表作品。',\n  location: '山西博物院',\n  category: '佛像'\n}, {\n  id: 21,\n  name: '彩绘木雕观音菩萨立像',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.laMHgFghygE3rqVx9EXECQHaM7?w=189&h=330&c=7&r=0&o=5&pid=1.7',\n  period: '宋代',\n  description: '这尊彩绘木雕观音菩萨立像制作于宋代，高约120厘米。菩萨面容端庄秀丽，身姿优美，衣饰华丽，彩绘保存完好，是宋代木雕艺术的代表作品，也是研究宋代佛教艺术的重要实物资料。',\n  location: '山西博物院',\n  category: '佛像'\n}, {\n  id: 22,\n  name: '双林寺释迦牟尼泥塑像',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.QSpjLBeyJ4xmW9mjLa1WHQHaKU?w=203&h=284&c=7&r=0&o=5&pid=1.7',\n  period: '唐代',\n  description: '这尊释迦牟尼泥塑像位于双林寺大佛殿内，制作于唐代，是中国现存唐代泥塑佛像的代表作品。佛像神态安详，比例协调，塑造技艺精湛，彩绘保存完好，展现了唐代佛教艺术的高超水平，是研究唐代佛教艺术的重要实物资料。',\n  location: '山西省忻州市繁峙县',\n  category: '佛像'\n},\n// 壁画类\n{\n  id: 23,\n  name: '永乐宫壁画',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.cnhMoUKg8c2Trw5jae03LQHaFd?w=224&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '元代',\n  description: '永乐宫壁画是元代道教壁画的代表作，总面积达1000多平方米。壁画内容以道教故事为主，绘画技艺精湛，人物形象生动，色彩艳丽，构图严谨，是中国古代壁画艺术的瑰宝，也是研究元代绘画和道教文化的重要实物资料。',\n  location: '山西省临汾市芮城县',\n  category: '壁画'\n}, {\n  id: 24,\n  name: '敦煌莫高窟飞天壁画',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.92RfCiBBxLcASR6CJ0GdXgHaEb?w=282&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '唐代',\n  description: '敦煌莫高窟飞天壁画是敦煌壁画中的经典题材，这幅壁画创作于唐代，以其优美的线条、鲜艳的色彩和飘逸的姿态著称。飞天形象体现了古代艺术家对美的追求和想象，是中国古代壁画艺术的杰出代表。',\n  location: '甘肃省酒泉市敦煌市',\n  category: '壁画'\n}, {\n  id: 25,\n  name: '永乐宫朝元图壁画',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C._1Se8tQRUAuc3FvSzDPa8AHaHa?w=169&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '元代',\n  description: '朝元图是永乐宫三清殿正壁的大型壁画，描绘了道教诸神朝拜元始天尊的场景。壁画人物众多，构图宏大，是中国壁画艺术史上的杰作。壁画技法娴熟，线描流畅，色彩艳丽，人物形象生动，充分展现了元代壁画的艺术水平。',\n  location: '山西省临汾市芮城县',\n  category: '壁画'\n}, {\n  id: 26,\n  name: '云冈石窟第6窟佛传故事壁画',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.uqvn6U6v-5NCxhwj31pxbwHaFj?w=270&h=202&c=7&r=0&o=5&pid=1.7',\n  period: '北魏',\n  description: '云冈石窟第6窟的佛传故事壁画创作于北魏时期，内容描绘了释迦牟尼佛的生平故事。壁画风格独特，融合了中原和西域的艺术元素，是研究北魏壁画艺术和佛教文化的重要实物资料。',\n  location: '山西省大同市云冈区',\n  category: '壁画'\n},\n// 青铜器类\n{\n  id: 27,\n  name: '司母戊鼎',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.4BFzCMGIxzNKf4btCTurOgHaHa?w=194&h=193&c=7&r=0&o=5&pid=1.7',\n  period: '商代',\n  description: '司母戊鼎又称\"后母戊鼎\"，是中国现存最大的商代青铜器，重达832.84千克。鼎呈方形，四足粗壮，腹部饰有兽面纹，铸造工艺精湛，是研究商代青铜铸造技术和礼制文化的重要实物资料。',\n  location: '山西博物院',\n  category: '青铜器'\n}, {\n  id: 28,\n  name: '毛公鼎',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.s5qdlvnWIg1m8czHVn6CTwHaEi?w=299&h=183&c=7&r=0&o=5&pid=1.7',\n  period: '西周',\n  description: '毛公鼎是西周晚期的重要青铜器，鼎内铸有长达497字的铭文，记录了周厉王赐爵给毛公的情况，是研究西周历史和礼制的重要资料。鼎的铸造工艺精湛，器形端庄，是中国古代青铜艺术的杰出代表。',\n  location: '山西博物院',\n  category: '青铜器'\n}, {\n  id: 29,\n  name: '曾侯乙尊盘',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.-Ds6g6vHKtq2U2Aa2PPeOQHaE8?w=278&h=185&c=7&r=0&o=5&pid=1.7',\n  period: '战国',\n  description: '曾侯乙尊盘是战国时期的青铜礼器，出土于湖北随州曾侯乙墓。尊盘造型独特，工艺精湛，表面装饰有精美的纹饰，是战国时期青铜艺术的代表作品，也是研究战国时期青铜铸造技术和礼制文化的重要实物资料。',\n  location: '山西博物院',\n  category: '青铜器'\n}, {\n  id: 30,\n  name: '虎食人铜案',\n  image: 'https://tse4-mm.cn.bing.net/th/id/OIP-C.xNbW2Xwbcf31luHluV5cPAHaFX?w=230&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '春秋',\n  description: '虎食人铜案是春秋时期的青铜器，造型为一只老虎正在咬食一个人。这件青铜器造型独特，寓意深刻，可能与古代的刑罚或宗教仪式有关，是研究春秋时期社会生活的重要实物资料。',\n  location: '山西博物院',\n  category: '青铜器'\n},\n// 其他现有条目\n{\n  id: 5,\n  name: '五台山',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.RR7H1OfckA28aB1uq0n6bQHaE8?w=227&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '明清',\n  description: '五台山是中国佛教四大名山之一，也是世界文化遗产。这里保存有大量的佛教寺庙和文物，如著名的五台山大佛、塔院寺等。五台山以其独特的自然风光和深厚的文化底蕴，成为了中国佛教文化的重要象征。',\n  location: '山西省忻州市五台县',\n  category: '古建筑'\n}, {\n  id: 6,\n  name: '悬空寺',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.db3MOrsKiJHGp7dvizGrtAHaFj?w=232&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '北魏',\n  description: '悬空寺是中国古代建筑的奇迹，始建于北魏时期，距今已有1500多年的历史。这座寺庙建在悬崖峭壁之上，建筑结构独特，令人惊叹。悬空寺不仅具有极高的建筑艺术价值，同时也是研究中国古代建筑的重要资料。',\n  location: '山西省大同市浑源县',\n  category: '古建筑'\n}, {\n  id: 7,\n  name: '乔家大院',\n  image: 'https://tse2-mm.cn.bing.net/th/id/OIP-C.1Euuw0IB4b4mr_kD7Ed-AgHaFj?w=240&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '明清',\n  description: '乔家大院是中国著名的传统民居建筑，始建于清代，距今已有300多年的历史。这座大院以其独特的建筑风格和精美的雕刻艺术而闻名，是中国传统建筑的杰出代表之一。',\n  location: '山西省晋中市祁县',\n  category: '古建筑'\n}, {\n  id: 8,\n  name: '王家大院',\n  image: 'https://tse3-mm.cn.bing.net/th/id/OIP-C.P-be5tbKOiCsZ5NL_jy2CwHaE3?w=241&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '明清',\n  description: '王家大院是中国著名的传统民居建筑，始建于清代，距今已有300多年的历史。这座大院以其独特的建筑风格和精美的雕刻艺术而闻名，是中国传统建筑的杰出代表之一。',\n  location: '山西省晋中市灵石县',\n  category: '古建筑'\n}, {\n  id: 9,\n  name: '常家庄园',\n  image: 'https://tse1-mm.cn.bing.net/th/id/OIP-C.w5OCxtouXh0C-nqO4SUIXAHaE6?w=256&h=180&c=7&r=0&o=5&pid=1.7',\n  period: '明清',\n  description: '常家庄园是中国著名的传统民居建筑，始建于清代，距今已有300多年的历史。这座大院以其独特的建筑风格和精美的雕刻艺术而闻名，是中国传统建筑的杰出代表之一。',\n  location: '山西省晋中市榆次区',\n  category: '古建筑'\n}];\nexports.heritageList = heritageList;//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///166\n");

